    "2016-08-10T19:11:59.110583",nt"name": "r6-fifra-e-notice-of-arrival",nt"isopen":
    true,nt"url": null,nt"notes": "This database processes approximately 3,000
    Notice of Arrival (NOA) reporting forms from importers and exporters of pesticide
    products. This is an electronic version of the EPA Form 3540-1. The external user
    fills out the NOA and submits it electronically. The form is then processed by the
    Pesticides section and either approved or disapproved. The system then generates
    an Adobe PDF version of the EPA Form 3540-1 with signature or disapproval and emailed
    to the external user. The e-filing system eliminates the need for the Region to
    invest in paper, copying, storage and mailing expenses, while at the same time allowing
    the regulated community to conduct its business with us in a more expeditious manner.",nt"license_title":
